import Home from './components/routes/home/home.component.jsx';
import {Routes, Route} from 'react-router-dom';

const Shop = () => {
  return (
    <h1>I am a shop component</h1>
  );
}

const App = () => {

  return (
    <Routes>
      <Route path='/home' element={<Home />} />
      <Route path='/shop' element={<Shop />} />
    </Routes>
  );
}

export default App;
